import React from 'react';
import { Header, Button } from 'semantic-ui-react'

const Nav = () => {
    return (
        <Header as='h2' floated='right'>
            Sage Jordan
            <Button basic color='red'>Home</Button>
            <Button basic color='red'>About</Button>
            <Button basic color='red'>Projects</Button>
        </Header>
    )
}

export default Nav;
